import React from "react";

function Experience(){
    return(
        <>
            <div className="container mt-5">
                <div className="row">
                    <div className="col-md-8">
                        <h1>Experience</h1>
                        <h2>Upwork</h2>
                        <h4>Freelancer</h4>
                        <p>Tasks: Web development including HTML, CSS, JavaScript, Reactjs, BootStrap</p>
                        <p>From 01/01/2020 to present</p>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Experience;
